import Preloader from "./components/preloader";
import {readTodos} from "./functions";
import { useEffect } from "react";

function App() {

  useEffect(() => {
      console.log('todos');
    const fetchData = async () => {
      const result = await readTodos();
      console.log(result);
    }
    fetchData()
  }, [])

  return (
    <div className="container">
      <div className="row">
        <form className="col s12">
          <div className="row">
            <div className="input-field col s6">
              <i className="material-icons 
              prefix">account_circle</i>
              <input id="icon_prefix" type="text" 
              className="validate"/>
              <label for="icon_prefix">Title</label>
            </div>
            <div className="input-field col s6">
              <i className="material-icons prefix">description</i>
              <input id="description" type="tel" className="validate"/>
              <label for="icon_telephone">content</label>
            </div>
          </div>
        </form>
        <Preloader />
        <ul className="collection">
          <li className="collection-item">Alvin<a href="#!" class="secondary-content"><i class="material-icons">create</i></a></li>
          <li className="collection-item">Alvin</li>
          <li className="collection-item">Alvin</li>
          <li className="collection-item">Alvin</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
